import React from 'react';
import { Text, View, TouchableOpacity } from 'react-native';
import { useIsLoggedIn, logUserIn, useLogOut } from '../Authcontext';
import { AntDesign } from '@expo/vector-icons';


export default () => {
    const isLoggedIn = useIsLoggedIn();
    const logIn = logUserIn();
    console.log(logIn);
    const logOut = useLogOut();
    console.log(logOut);

    return (<View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
        {isLoggedIn === true ? <TouchableOpacity onPress={logOut}>
            <Text>
                <AntDesign name="star" size={100} color="black" />
            </Text>
        </ TouchableOpacity>
            :
            <TouchableOpacity onPress={logIn}>
                <Text>
                    <AntDesign name="staro" size={100} color="black" />
                </Text>
            </TouchableOpacity>
        }
    </View>);
}
